p-block-column\"><!-- wp:heading -->\n<h2><span class=\"has-inline-color has-luminous-vivid-orange-color\">STAGE 1</span><br>Determine<br>Your Needs</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We assess with the client the scope and determine what needs to be completed and tailor a plan of action to individual client needs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading -->\n<h2><span class=\"has-inline-color has-luminous-vivid-orange-color\">STAGE 2</span><br>Morning<br>of Move</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul id=\"block-e317c3bb-3a8d-49b1-987d-521eb905872f\"><li>Oversee movers and&nbsp;supervise packing.</li><li>Liaise with movers, property&nbsp;vendor and purchaser,&nbsp;deliveries.</li><li>Supervise packing inventory&nbsp;and labelling.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading -->\n<h2><span class=\"has-inline-color has-luminous-vivid-orange-color\">STAGE 3</span><br>After of<br>of Move</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul id=\"block-b6000a01-0493-4b71-8e56-7dacbcc10739\"><li>Oversee unloading of truck, check inventory and oversee placement of furniture &amp; boxes.</li><li>Supervise unpacking and placement of personal items.</li><li>Note any damages before signing of invoice.</li><li>Arrange carton collection.</li><li>Organise any additional services (picture hanging etc, carpet cleaning, domestic or commercial cleaning.)<br><br><br><br><br><br></li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Move Coordination', '', 'publish', 'open', 'open', '', 'move-coordination', '', '', '2021-01-02 03:59:15', '2021-01-02 03:59:15', '', 0, 'http://localhost/wordpress/?p=116', 0, 'post', '', 0),
