(118, 1, '2020-12-29 06:54:09', '2020-12-29 06:54:09', '<!-- wp:group {\"backgroundColor\":\"white\"} -->\n<div class=\"wp-block-group has-white-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><br><br>How Will A Move Coordination Help Me?<br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">We guide you through the process of assessing the scope and requirements of your move, handling the pre-move research<br>including removalists quotations, connection of utilities, updating all contact details, recording inventory and coordinating all moving day logistics.<br>Our Move Coordinators will plan the layout in your new home, organise all goods for packing and organise all items for sale, donations,<br>storage and rubbish and oversee the packing process.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">On moving day our Move Coordinator will oversee and liaise with the removalists, organise deliveries and any required trades services. The placement of furniture at your new home will be arranged with efficiency and care and the unpacking will be supervised.<br>Any damages will be noted before signing off with the mover. We can take care of everything and organise your entire move for you.<br><br><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"style\":{\"color\":{\"background\":\"#e6e8ea\"}}} -->\n<div class=\"wp-block-group has-background\" style=\"background-color:#e6e8ea\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\"><br><br>Move Coordination Plan Of Action<br><br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading -->\n<h2><span class=\"has-inline-color has-luminous-vivid-orange-color\">STAGE 1</span><br>Determine<br>Your Needs</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>We assess with the client the scope and determine what needs to be completed and tailor a plan of action to individual client needs.</p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading -->\n<h2><span class=\"has-inline-color has-luminous-vivid-orange-color\">STAGE 2</span><br>Morning<br>of Move</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul id=\"block-e317c3bb-3a8d-49b1-987d-521eb905872f\"><li>Oversee movers and&nbsp;supervise packing.</li><li>Liaise with movers, property&nbsp;vendor and purchaser,&nbsp;deliveries.</li><li>Supervise packing inventory&nbsp;and labelling.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading -->\n<h2><span class=\"has-inline-color has-luminous-vivid-orange-color\">STAGE 3</span><br>After of<br>of Move</h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul id=\"block-b6000a01-0493-4b71-8e56-7dacbcc10739\"><li>Oversee unloading of truck, check inventory and oversee placement of furniture &amp; boxes.</li><li>Supervise unpacking and placement of personal items.</li><li>Note any damages before signing of invoice.</li><li>Arrange carton collection.</li><li>Organise any additional services (picture hanging etc, carpet cleaning, domestic or commercial cleaning.)</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Move Coordination', '', 'inherit', 'closed', 'closed', '', '116-revision-v1', '', '', '2020-12-29 06:54:09', '2020-12-29 06:54:09', '', 116, 'http://localhost/wordpress/2020/12/29/116-revision-v1/', 0, 'revision', '', 0),
(119, 1, '2020-12-28 06:54:00', '2020-12-28 06:54:00', '<!-- wp:paragraph -->\n<p><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:group {\"style\":{\"color\":{\"background\":\"#e8eaec\"}}} -->\n<div class=\"wp-block-group has-background\" style=\"background-color:#e8eaec\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><br><br><br>What Do You Need TO Know?<br><br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Ask the removalist for a written itemised quote including flat or hourly rate, timing, penalty fees, number of staff on the job,<br>insurance and if furniture will be wrapped for protection? Carefully read the contract, check all details are correct<br>(including both addresses and dates), note the terms and conditions. Keep your removalist up to date with any changes,<br>as late changes are expensive and inform them of any access difficulties &amp; steps.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\"><br><br>Plan Ahead For Moving Day<br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Check parking requirements for the moving truck at both properties and obtain parking permits if relevant.<br>Inform neighbours of parking needs prior to moving day. Start your packing well ahead, don’t forget your priority carton.<br>MOVINGHOUSE&nbsp;can assist with your decluttering, sorting &amp; packing. On moving days have access to snacks, water &amp; drinks<br>to ensure everyone is well hydrated.<br><br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">WE CAN SUGGEST REMOVALISTS THAT CAN PROVIDE A FULL PACKING SERVICE, PACKING MATERIALS, TRANSIT INSURANCE AND MOVE.<br>MOVINGHOUSE&nbsp;CAN CUSTOMISE OUR SERVICE TO MEET YOUR REQUIREMENTS.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->', 'Removalist service', '', 'publish', 'open', 'open', '', 'removalist-service', '', '', '2020-12-29 06:55:38', '2020-12-29 06:55:38', '', 0, 'http://localhost/wordpress/?p=119', 0, 'post', '', 0),
