(121, 1, '2020-12-29 06:55:38', '2020-12-29 06:55:38', '<!-- wp:paragraph -->\n<p><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:group {\"style\":{\"color\":{\"background\":\"#e8eaec\"}}} -->\n<div class=\"wp-block-group has-background\" style=\"background-color:#e8eaec\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><br><br><br>What Do You Need TO Know?<br><br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Ask the removalist for a written itemised quote including flat or hourly rate, timing, penalty fees, number of staff on the job,<br>insurance and if furniture will be wrapped for protection? Carefully read the contract, check all details are correct<br>(including both addresses and dates), note the terms and conditions. Keep your removalist up to date with any changes,<br>as late changes are expensive and inform them of any access difficulties &amp; steps.<br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\"><br><br>Plan Ahead For Moving Day<br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Check parking requirements for the moving truck at both properties and obtain parking permits if relevant.<br>Inform neighbours of parking needs prior to moving day. Start your packing well ahead, don’t forget your priority carton.<br>MOVINGHOUSE&nbsp;can assist with your decluttering, sorting &amp; packing. On moving days have access to snacks, water &amp; drinks<br>to ensure everyone is well hydrated.<br><br><br></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">WE CAN SUGGEST REMOVALISTS THAT CAN PROVIDE A FULL PACKING SERVICE, PACKING MATERIALS, TRANSIT INSURANCE AND MOVE.<br>MOVINGHOUSE&nbsp;CAN CUSTOMISE OUR SERVICE TO MEET YOUR REQUIREMENTS.</p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->', 'Removalist service', '', 'inherit', 'closed', 'closed', '', '119-revision-v1', '', '', '2020-12-29 06:55:38', '2020-12-29 06:55:38', '', 119, 'http://localhost/wordpress/2020/12/29/119-revision-v1/', 0, 'revision', '', 0),
(122, 1, '2020-12-25 06:55:00', '2020-12-25 06:55:00', '<!-- wp:group {\"style\":{\"color\":{\"background\":\"#e8e9ea\"}}} -->\n<div class=\"wp-block-group has-background\" style=\"background-color:#e8e9ea\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><br><br>Don\'t Lift a Finger !!<br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Before your move we recommend you have the house organised for packing. A Pre Move Service can work with you a day or two before the packing day to prepare the house for your move. Our experienced staff can help make all the difference in assisting you to prepare the home for packing and moving.<br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list -->\n<ul><li>Cleaning and sorting the pantry by disposing of out of date items, placing open packages into plastic containers, disposing of items not suitable for shipping.<br><br></li><li>Sorting and preparing rooms for different destinations such as a storage facility, shipping overseas, a weekender or a city base.<br><br></li><li>White goods and appliances including refrigerator, freezer, coffee maker, microwave, food processor etc. cleaned and prepared for moving.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list -->\n<ul><li>Preparing a breakfast or lunch box with tea, coffee, cups and bowls, cutlery, cereal, bread, jam, toaster, kettle.<br><br></li><li>Preparing essentials box including remote controls, keys, bed legs, shelf supports.<br><br></li><li>Preparing playrooms and children’s rooms by sorting puzzles, books, games.<br><br></li><li>First night survival box prepared with linen, towels, medications, toiletries, clothes for the next day, pet food and lead, special toy.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p><br><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"backgroundColor\":\"white\"} -->\n<div class=\"wp-block-group has-white-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><br><br>Packing Services<br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">MOVINGHOUSE can provide a full packing service. However, if you are planning on packing some things yourself<br>or doing sorting/downsizing and packing, our professionally trained staff can help you pack&nbsp;&amp; carefully label your goods.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">If you are organising the move yourself you can decide how to structure the pack. If you are planning&nbsp;on doing<br>some packing yourself, you can have professional staff to pack the kitchen&nbsp;and breakables&nbsp;while you take care of the rest!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Delivery of the boxes &amp; packing materials needed can be organised – Various size cartons, butchers paper, tape &amp; bubble wrap.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">If you need help sorting before you pack let a Home Organising service help you.<br>TRY NOT TO PACK THINGS YOU DON’T WANT – IT ONLY COSTS YOU MONEY<br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"backgroundColor\":\"cyan-bluish-gray\"} -->\n<div class=\"wp-block-group has-cyan-bluish-gray-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading -->\n<h2><br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.movinghouse.com.au/wp-content/uploads/2018/02/logo-icon.png\" alt=\"\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\">MOVINGHOUSE Tips For Packing<br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list -->\n<ul><li>Pack a survival kit that includes essentials for first night including school uniform &amp; books breakfast foods and pet food..<br><br></li><li>Pack lighter items including plastics and cushions in larger boxes &amp; heavier items including crystal and china into smaller boxes,<br><br></li><li>Use clean white butchers paper for wrapping. NO NEWSPAPER as it leaves dirty marks on items.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list -->\n<ul><li>Label cartons to indicate the room its going into in your new house.<br><br></li><li>Fasten electrical cords with plastic ties.<br><br></li><li>Layer your goods into cartons – heaviest items on the bottom, lightest on the top.<br><br></li><li>Pack books with spine on the bottom. Don’t overpack these cartons or they are too heavy to lift.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->', 'Packing service', '', 'publish', 'open', 'open', '', 'packing-service', '', '', '2020-12-29 06:57:41', '2020-12-29 06:57:41', '', 0, 'http://localhost/wordpress/?p=122', 0, 'post', '', 0),
