 class=\"wp-block-group has-cyan-bluish-gray-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading -->\n<h2><br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:image {\"align\":\"center\"} -->\n<div class=\"wp-block-image\"><figure class=\"aligncenter\"><img src=\"https://www.movinghouse.com.au/wp-content/uploads/2018/02/logo-icon.png\" alt=\"\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\">MOVINGHOUSE Tips For Packing<br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list -->\n<ul><li>Pack a survival kit that includes essentials for first night including school uniform &amp; books breakfast foods and pet food..<br><br></li><li>Pack lighter items including plastics and cushions in larger boxes &amp; heavier items including crystal and china into smaller boxes,<br><br></li><li>Use clean white butchers paper for wrapping. NO NEWSPAPER as it leaves dirty marks on items.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:list -->\n<ul><li>Label cartons to indicate the room its going into in your new house.<br><br></li><li>Fasten electrical cords with plastic ties.<br><br></li><li>Layer your goods into cartons – heaviest items on the bottom, lightest on the top.<br><br></li><li>Pack books with spine on the bottom. Don’t overpack these cartons or they are too heavy to lift.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->', 'Packing service', '', 'inherit', 'closed', 'closed', '', '122-revision-v1', '', '', '2020-12-29 06:57:41', '2020-12-29 06:57:41', '', 122, 'http://localhost/wordpress/2020/12/29/122-revision-v1/', 0, 'revision', '', 0),
(125, 1, '2020-12-29 06:58:00', '2020-12-29 06:58:00', '<!-- wp:group -->\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\"><!-- wp:heading {\"textAlign\":\"center\",\"level\":3} -->\n<h3 class=\"has-text-align-center\"><br><br><br>Get A Quote Today<br><br></h3>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">MOVINGHOUSE unpacking service can unpack the entire house or just the rooms you prefer. After the removalists have unloaded, let the experts step in. With each move we offer our individual and expert attention to detail.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"align\":\"center\"} -->\n<p class=\"has-text-align-center\">Our staff are professional homemakers: dedicated, meticulous and capable and really care about the finished product. Discretion is assured.&nbsp;The aim is to create a delightful, organised home set up by a team of detail-driven<br>and house proud people.<br><br><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->\n\n<!-- wp:group {\"className\":\"padding: 50px\",\"backgroundColor\":\"cyan-bluish-gray\"} -->\n<div class=\"wp-block-group padding: 50px has-cyan-bluish-gray-background-color has-background\"><div class=\"wp-block-group__inner-container\"><!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\"><br><br>Our Unpacking Service<br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>All cupboards wiped, cartons unpacked and items placed in cupboards.<br><br></li><li>Kitchens functional, food items placed into pantry and refrigerator<br><br></li><li>Bedrooms set-up, clothing organised and placed into wardrobes.<br><br></li><li>Beds made up with fresh linen and Bathrooms organised<br></li><li>Childrens’ rooms set up for study and play.<br><br></li><li>Linen cupboard beautifully arranged.<br><br></li><li>Books and ornaments unpacked and displayed with great care.<br><br></li><li>Cartons folded and prepared for collection.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:heading {\"textAlign\":\"center\"} -->\n<h2 class=\"has-text-align-center\"><br><br>Our Unpacking Tips<br><br></h2>\n<!-- /wp:heading -->\n\n<!-- wp:list -->\n<ul><li>Make sure all cupboards are clean and wiped out before you start, use non slip drawer liners so china does not move around.<br><br></li><li>Start with the kitchen – it is the most difficult and time consuming and is required first when moving.<br><br></li><li>Take the essential box in your car when you move. Unpack this first as it contains everything you need for the first night.<br><br></li><li>Make sure the linen is in a box that is clearly marked so the beds can be made up as soon as possible as everyone will be very tired at the end of the day.<br><br></li><li>Check all boxes for any items left inside before they are stacked up for collection.</li></ul>\n<!-- /wp:list --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p><br></p>\n<!-- /wp:paragraph --></div></div>\n<!-- /wp:group -->', 'Unpacking service', '', 'publish', 'open', 'open', '', 'unpacking-service', '', '', '2020-12-29 06:59:38', '2020-12-29 06:59:38', '', 0, 'http://localhost/wordpress/?p=125', 0, 'post', '', 0),
